import React, { Component } from "react";
import { Link, animateScroll as scroll } from "react-scroll";

export default class Navbar extends Component {
  scrollToTop = () => {
    scroll.scrollToTop();
  };
  render() {
    return (
      <nav className="nav" id="navbar">
        <div className="nav-content">
          <ul className="nav-items">
            <li className="nav-item" onClick={this.scrollToTop}>
              <Link
                activeClass="active"
                to="Home"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                Mahip Deora
              </Link>
            </li>
            <li className="nav-item" onClick={this.scrollToTop}>
              <Link
                activeClass="active"
                to="Home"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                Home
              </Link>
            </li>
            <li className="nav-item">
              <Link
                activeClass="active"
                to="About"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                About
              </Link>
            </li>
            <li className="nav-item">
              <Link
                activeClass="active"
                to="Professional Experience"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                Professional Experience
              </Link>
            </li>
            <li className="nav-item">
              <Link
                activeClass="active"
                to="Extracurriculars"
                spy={true}
                smooth={true}
                offset={-70}
                duration={500}
              >
                Extracurriculars
              </Link>
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}
